import React from "react";
import logo from "../images/logo.png";
export default function Navbar() {
  return (
    <header>
      <nav className="navbar">
        <img src={logo} alt="logo" />
        <h2>MemeGenerator</h2>
      </nav>
    </header>
  );
}
